import React from 'react';
import './App.css';
import Header from './components/pages/Header.component';
import Navbar from './components/layout/Navbar';
import '../node_modules/bootstrap/dist/css/bootstrap.css';
import '../node_modules/jquery';


function App() {
  return (
    <>
      <Navbar />
      <p>Hello world</p>
      <Header />
    </>
  );
}

export default App;
